import { makeStyles } from '@material-ui/core/styles';
import React from 'react';
import annotationlist from '../../static/annotationlist.json';
import TextField from '@material-ui/core/TextField';
import FormControl from '@material-ui/core/FormControl';
import Button from '@material-ui/core/Button';
import Checkbox from '@material-ui/core/Checkbox';
import clsx from 'clsx';

const qalist = annotationlist.annotatonlist;


function qaform(resultKey, resultValue) {
    return (
        <FormControl>
            <div style={{ marginBottom: '5%', display:'flex', flexDirection:"row" }}>
                <Checkbox />
                <TextField
                    label={resultKey}
                    defaultValue={resultValue}
                    variant="outlined"
                    fullWidth
                    InputProps={{
                        readOnly: true,
                    }}
                />
            </div>
        </FormControl>
    );
}


const useStyles = makeStyles((theme) => ({
    root: {
        height: '100%',
    },
    list: {
        height: '85%',
        display: 'flex',
        flexDirection: 'column',
        overflow: 'auto',
        padding: theme.spacing(2),
        border:'solid'
    },
    btn: {
        display:'block',
    },
    listHead: {
        border:'solid',
        height:'7%'
    },
    highlight: {

    }
}));

function handleDelete() {
    alert("delete");
}

export default function QAList({ fileId }) {
    const classes = useStyles();
    const [selected, setSelected] = React.useState([]);
    const numSelected = selected.length;

    return (
        <div className={classes.root}>
            <div className={clsx(classes.listHead, {
                        [classes.highlight]: numSelected > 0,
                    })}>
                head
            </div>


            <div className={classes.list} id='qalist'>
                {
                    qalist.map((qa) => {
                        if (qa.fileID === fileId)
                            return qaform(qa.resultKey, qa.resultValue)
                        else
                            return null
                    })
                }
            </div>
            {/* <div className={classes.btn}><Button variant="contained" color='secondary' fullWidth onClick={handleDelete}>delete</Button></div> */}
        </div>
    );
}
